import * as React from "react";

class EmployeeList extends React.Component {
    render() {
        return (
			<div>
  	            {this.props.employees.map(employee => {
                    if (
                        2 > 1
                        // this.props.allocations.filter(
                        // allocation => (allocation.id > 0
                        // /*&& allocation.projectId === this.props.projectId*/)).length > 0
                    )
                    return <div>
                        {employee.name}
                        {/* {this.props.allocations.filter(allocation =>
                            allocation.name === employee.name && 
                            allocation.project === this.props.projectTitle)
                            .map(allocation => <Allocation {...allocation}/>                  
                            )} */}
                    </div>
                }
                )}
			</div>		
		);
	}
}

class Allocation extends React.Component {
	render() {
  	const allocation = this.props;
  	return (
    	<div>
          <div>Role: {allocation.role} Months: {allocation.startMonth}-{allocation.endMonth} Allocation: {allocation.allocation} Weight: {allocation.weight}</div>
    	</div>
    );
  }
}
export default EmployeeList;
